import React from "react";

const DropDown = () => {
  return (
    <div>
      <select label={this.props.title} class="ui selection dropdown">
        <option value="">Gender</option>
        <option value="1">Male</option>
        <option value="0">Female</option>
      </select>
    </div>
  );
};

export default DropDown;
